description:
Adrianna Laurenti, Lea De Mae, Melanie Coste, Monica Sweetheart, Sandy Style, Tiffany Hopkins 

Studio : Marc Dorcel
Released : 05/2004 
Director : John B Root 

Take a grand tour of the ultimate palace of decadence. The madam at this house of pleasure has honed the art of love to a fine edge. Watch as a novice learns the sophisticated lessons of seduction, and the whole house seems to come alive to the pursating rhythm of carnal gratification.

